from typing import List

def get_substring_positions(dna: str, sub: str) -> List[int]:
    return [i + 1 for i in range(len(dna)) if dna.startswith(sub, i)]

if __name__ == '__main__':
    dataset = [
        '',
        'AAGAAAAAA'
    ]
    result = get_substring_positions(*dataset)
    print(*result)